Amsterdam (; basa Belanda ) inggih punika ibu kota Belanda taler kota pinih ageng ring Belanda. Genah Amsterdam sané mangkin dados ibu kota Krajan Belanda kaatur olih konstitusi 24 Agustus 1815 miwah palantur nyané. Amsterdam ngelah akéh panjak kirang langkung 980.876 diri ring wates kota, populasi pakotaan 1.209.419 diri miwah populasi metropolitan 2.158.592 diri. Kota puniki magenah ring propinsi Holland Kalér ring sisi kauh negara puniki. Wawengkon Amsterdam ngajangkepin sisi kalér Randstad, silih tunggil konurbasi pinih ageng ring Éropa antuk akéh panjak sawatara 7 yuta diri.
Galeri.
