Piala Jagat FIFA 1938 inggih punika édisi katiga saking Piala Jagat, wimbakara internasional sépakbola nyabran petnag warsa antuk tim nasional putra sénior miwah kamargiang ring Prancis saking 4 Juni ngantos 19 Juni 1938. Itali ngapertahanang gelar nyané ring final, ngalahang Hungaria 4–2. Tim Italia warsa 1934 miwah 1938 polih gelar jayanti Piala Jagat tunggal ring sor pelatih sané pateh, Vittorio Pozzo. Puniki pacang dados Piala Jagat ungkur ngantos 1950 krana wénten Yuda Jagat II.
