Piala Jagat FIFA 1958 inggih punika édisi kaping nem Piala Jagat FIFA, wimbakara sépakbola nyabran papat warsa antuk tim nasional putra sénior, wimbakara puniki kaselenggara ring Swédia saking 8 ngantos 29 Juni 1958. Punika Piala Jagat FIFA kapertama sané kamargiang ring Negara Nordik. Brasil ngaonang Swédia 5–2 ring final, ring Stockholm sisi kota Solna antuk nampi gelar jayanti kapertama dané. Wimbakara puniki taler ngacihnain karauhan Pelé ring aab punika kantun mayusa 17 warsa ring Piala Jagat.
